import React from "react";
// import "./style.css"


function Jumbotron() {
  return (
    <div className="jumbotron text-center">
      <h1>
          <a className="white" id="jumboHead" href="/">Reading List</a>
          
          </h1>
       
      
    </div>
  );
}



export default Jumbotron;
